import React from 'react';
import { View, ScrollView, Text, Dimensions, TouchableOpacity } from 'react-native';

function Profile(props) {
    const window = Dimensions.get('window')

    return (
        <ScrollView style={{
            height: '100%',
            width: '100%',
            backgroundColor: 'red',
            flexDirection: 'column',
            overflow: 'visible',
            

        }}>
            <View style={{
                width: window.width / 5,
                height: window.width / 5,
                borderRadius: window.width / 10,
                backgroundColor: 'white',
                marginTop: 100,
                position: 'absolute',
                zIndex: 60,
                bottom: 6,
                left: '40%',
                alignItems: 'center',
                shadowOffset: {
                    height: 1,
                    width: 1,
                },
                shadowColor: 'black',
                shadowOpacity: .5,
                elevation: 5,
                shadowRadius: '50%',
                overflow: 'visible',

            }}>

            </View>

            <View style={{
                height: 200,
                width: '100%',
                backgroundColor: 'black',
                borderBottomEndRadius: 50,
                borderBottomStartRadius: 50,


            }}>


            </View>
            <View style={{
                height: 300,
                backgroundColor: 'white',
                width: '90%',
                justifyContent: 'center',
                alignItems: 'center',
                margin: 20,
                borderRadius:20,

            }}>

            </View>


        </ScrollView>
    );
}

export default Profile;
